  if (form.get('Date of last period').getValue() === undefined) {} else {
    var menstrual = new Date();
    var ovulation = new Date();
    var duedate = new Date();
    var today = new Date();
    var cycle = 0;
    var luteal = 0;
    var menstrualValue = form.get('Date of last period').getValue();

    var menstrualinput = new Date(menstrualValue);
    menstrual.setTime(menstrualinput.getTime());
    cycle = 28;
    luteal = 14;

    ovulation.setTime(menstrual.getTime() + (cycle * 86400000) - (luteal * 86400000));
    duedate.setTime(ovulation.getTime() + 266 * 86400000);

    var month = duedate.getMonth() + 1;
    month = (month < 10) ? "0" + month : month;

    var day = duedate.getDate();
    day = (day < 10) ? "0" + day : day;

    var year = duedate.getYear();
    if (year < 2000) year += 1900;

    form.get('Estimated date of delivery').setValue(year + "-" + month + "-" + day);


    var fetalage = 14 + 266 - ((duedate - today) / 86400000);

    var weeks = parseInt(fetalage / 7);

    form.get('Number of Weeks').setValue(weeks);


    var days = Math.floor(fetalage % 7);
    form.get('Number of Days').setValue(days);

  }
